                        <Nav.Link href="/educacao">Educação</Nav.Link>
                        <Nav.Link href="/tec">Tecnologia</Nav.Link>
                      </Nav>
                      
                    </Navbar.Collapse>
                    
                </Navbar>
                </div>
        );


}


const navbar={
  backgroundColor:"RGB(217, 201, 85)",


}
